  true,\n\t\"url\": null,\n\t\"notes\": \"Procurement Technical Assistance Centers
  (PTACs) provide local, in-person counseling and training services for you, the small
  business owner. They are designed to provide technical assistance to businesses
  that want to sell products and services to federal, state, and/or local governments.
  PTAC services are available either free of charge, or at a nominal cost. PTACs are
  part of the Procurement Technical Assistance Program, which is administered by the
  Defense Logistics Agency.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
